import logo from './logo.svg';
import './App.css';
import AskOut from './components/AskHerOut';
import Yes from './components/Yes';

function App() {
  return (
    <Router>
        <Switch>
            <Route path="/" exact component={AskOut} />
            <Route path="/yes" component={Y} />
        </Switch>
    </Router>
  );
}

export default App;
